(sr_part_pack_id, supplier_no, supplier_part_no, pack_type, part_qty, parent_pack_type, pack_length, pack_width, pack_height, pack_weight_gross, pack_weight_net, sr_part_pack_rmk01, sr_part_pack_rmk02, sr_part_pack_rmk03, sr_part_pack_rmk04, sr_part_pack_rmk05, sr_part_pack_rmk06, sr_part_pack_rmk07, sr_part_pack_rmk08, sr_part_pack_rmk09, sr_part_pack_rmk10, crt_time, crt_user, crt_user_no, crt_user_name, crt_host, upd_time, upd_user_no, upd_user, upd_user_name, upd_host)
